const Login = (): React.ReactElement => {
  const [form] = useForm();
  return (
    <MainLayout sidebarCollapsed>
      <div id="login-page">
        <Card title="Sign in">

          <Input />
        </Card>
      </div>
    </MainLayout>
  );
};

export default Login;
